import React from 'react';
import Header from './js/layout/header';
import Footer from './js/layout/footer';
import Cities from './js/layout/cities';
import Market from './js/layout/market';
import FeautedListings from './js/layout/featured_listings';
import './sass/main.scss';

function App() {
  return (
    <div className='App'>
      <Header></Header>
      <Cities></Cities>

      <Market></Market>
      <Footer></Footer>
    </div>
  );
}

export default App;
